import{useState,useEffect} from "react"

function SecondFrontPage() {

const [data,setDate]=useState([])
function click(){
fetch("www.themealdb.com/api/json/v1/1/search.php?s=Arrab")
.then((response)=>response.json())
.then((datas)=>{
    console.log(datas)
 const meme=datas.map((data)=>{
    return<div>
         <h2>{data.name}</h2>
         <img src={data.url}/>
     </div>
 })
  setDate(meme) })
.catch((e)=>{
    console.log(e);
})}
useEffect(()=>{
click()

},[])

  return <div>
     {data}
  </div>;
}

export default SecondFrontPage;
